// 1) Récupération des noms de ref ("Code"), coordonnés RGB ("R", "G", et "B"), nom de la couleurs ("Nom") et coordonnés en HEX ("HEX").

// ------------ CONVERT HEX COLOR IN HSL -------------------- //

function hexToHSL (H) {
  // Convert hex to RGB first
  let red = 0
  let green = 0
  let blue = 0
  if ((H.length === 4)) {
    red = '0x' + H[1] + H[1]
    green = '0x' + H[2] + H[2]
    blue = '0x' + H[3] + H[3]
  } else if ((H.length === 7) || (H.length === 8)) {
    red = '0x' + H[1] + H[2]
    green = '0x' + H[3] + H[4]
    blue = '0x' + H[5] + H[6]
  }
  // Then to HSL
  red /= 255
  green /= 255
  blue /= 255
  const cmin = Math.min(red, green, blue)
  const cmax = Math.max(red, green, blue)
  const delta = cmax - cmin
  let hue = 0
  let sat = 0
  let lum = 0

  if (delta === 0) {
    hue = 0
  } else if (cmax === red) {
    hue = ((green - blue) / delta) % 6
  } else if (cmax === green) {
    hue = (blue - red) / delta + 2
  } else {
    hue = (red - green) / delta + 4
  }

  hue = Math.round(hue * 60)

  if (hue < 0) { hue += 360 }

  lum = (cmax + cmin) / 2
  sat = delta === 0 ? 0 : delta / (1 - Math.abs(2 * lum - 1))
  sat = +(sat * 100).toFixed(1)
  lum = +(lum * 100).toFixed(1)

  const hsl = [hue, sat, lum]
  return hsl
}

ListColor.list_1 = []
ListColor.Hexa_1 = []

function convertHSL (arrayHslConvert, arrayHexFollower) {
  ListColor.Hexa.forEach(function (item, index) {
    arrayHslConvert[index] = hexToHSL(ListColor.Hexa[index])
    arrayHexFollower[index] = ListColor.Hexa[index]
  })
}

// 2) Fonction pour convertir un array de couleur RGB en un array de couleur HSL.

// ------------ FILTER BY HSL'S SETTING ------------- //

// Filtrer in ascending order for hue or sat or lum (index = 0 or 1 or 2)

function filterHSL (arrayHsl, arrayHex, index) {
  const arrayHexLenght = arrayHsl.length
  for (let i = 0; i < arrayHexLenght; i++) {
    for (let j = 0; j < arrayHexLenght; j++) {
      if (arrayHsl[i][index] < arrayHsl[j][index]) {
        const copyArrayHsl = arrayHsl[i]
        arrayHsl[i] = arrayHsl[j]
        arrayHsl[j] = copyArrayHsl
        const copyArrayHex = arrayHex[i]
        arrayHex[i] = arrayHex[j]
        arrayHex[j] = copyArrayHex
      }
    }
  }
//   return arrayHsl, arrayHex
}

