// Create 5 or 4 colors by slider's value

const containerColor = document.querySelector('.container')

function CreateRange (a, b) {
  const ulItem = document.createElement('ul')

  convertHSL(ListColor.list_1, ListColor.Hexa_1)
  filterHSL(ListColor.list_1, ListColor.Hexa_1, 0)
  ScallHueSat(a, b)

  SatGradient()

  ulItem.className = 'color_container'
  containerColor.appendChild(ulItem)

  ListColor.list_3.forEach(function (item, index) {
    const liItem = document.createElement('li')
    liItem.style.background = ListColor.Hexa_3[index]
    liItem.className = 'color'
    ulItem.appendChild(liItem)
  })
}

